import React from 'react'
import { Link, useParams } from 'react-router-dom'

const ListItem = ({book}) => {
    return (
        <Link to={`/book/${book.id}`}>
        <h3>{book.title} :: {book.id}</h3>
        <h7>{book.isbn}</h7>
        <h5>{book.author.firstname} {book.author.lastname}</h5>
        </Link>
    )
}

export default ListItem
